import React from "react";
import { useState, useEffect } from "react";
import { Grid, TextField, Paper, Input } from "@material-ui/core";
import useStyles from "./courseDescriptionStyles";
import { useForm, Form } from "./useForm";

const CourseDescription1 = () => {
  const classes = useStyles();
  const intialFValues = {
    courseName: "",
    courseCode: "",
    semester: "",
    branch: "",
    monthFrom: "",
    monthTo: "",
    creditsLecture: "",
    creditsTutorial: "",
    creditsLab: "",
    contactHours: "",
    coordinatorNames: [],
    teacherNames: [],
    courseOutcomes: [],
    modules: [],
    eval: "",
    books: [],
  };
  const { values, setValues, handleInputChange } = useForm(intialFValues);

  return (
    <Paper className={classes.pageContent}>
      <Grid container>
        <Grid item xs={6}>
          <TextField
            variant="outlined"
            label="Course Name:"
            name="courseName"
            value={values.courseName}
            onChange={handleInputChange}
            InputLabelProps={{ shrink: true }}
          />
          <TextField
            variant="outlined"
            label="Course Code:"
            name="courseCode"
            value={values.courseCode}
            onChange={handleInputChange}
            InputLabelProps={{ shrink: true }}
          />
        </Grid>
        <Grid item xs={6}></Grid>
      </Grid>
    </Paper>
  );
};

export default CourseDescription1;
